import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";
import App from "./App";
import NavBar from "./components/Header";
import Footer from "./components/Footer";

// React component
function HomeView() {
  return (
    <div className="home">
      <h1>HOME</h1>
      <ul>
        <h2>React is great</h2>
        <li>
          It's popular library, so you'll be able to fit in with the cool kids
        </li>
        <li>It's more likely to get a job as a developer if you know react.</li>
        <li>It's easy to use.</li>
      </ul>
    </div>
  );
}

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <NavBar />
    <HomeView />
    <Footer />
  </React.StrictMode>
);
